--
-- Triggers `users`
--
DELIMITER $$
CREATE TRIGGER `before_insert_users` BEFORE INSERT ON `users` FOR EACH ROW BEGIN
    DECLARE max_id INT DEFAULT 0;
    DECLARE new_id VARCHAR(10);

    -- Get the numeric part of the highest existing ID
    SELECT IFNULL(MAX(CAST(SUBSTRING(user_id, 4) AS UNSIGNED)), 0)
    INTO max_id
    FROM users;

    -- Format the new ID: SR-001, SR-002, ...
    SET new_id = CONCAT('SR-', LPAD(max_id + 1, 3, '0'));

    -- Assign to the new row
    SET NEW.user_id = new_id;
END
$$
DELIMITER ;

